import { useState } from "react";
import Banner from "../Banner/Banner";
import VideoProductions from "../../VideoProductions/VideoProductions";
import PhotoProductions from "../PhotoProductions/PhotoProductions";
import "./Productions.css";

function Productions() {
  const [clickedVideoProductions, setclickedVideoProductions] = useState(true);
  const [clickedPhotoProductions, setclickedPhotoProductions] = useState();

  const HandleVideos = () => {
    if (setclickedVideoProductions == true) {
      setclickedVideoProductions === false;
    } else if (setclickedVideoProductions == false) {
      setclickedVideoProductions === true;
    }
  };
  return (
    <>
      <Banner />
      <div className='container-buttons'>
        <button clicked='true' onClick={HandleVideos} className='container-buttons-btn-gradient'>
          Videos
        </button>
        <button
          chicled='false'
          onClick={(e) => setclickedPhotoProductions(e.target.cliked)}
          className='container-buttons-btn-gradient'>
          Phothos
        </button>
      </div>
      {clickedVideoProductions ? (
        <div className='video-section-container'>
          <VideoProductions />
        </div>
      ) : (
        ""
      )}
      {clickedPhotoProductions ? <PhotoProductions /> : ""}
    </>
  );
}

export default Productions;
